import React from 'react';
//import {App} from './App.js'
import Background from './RestaurantSiteBG.jpg';

//var App = require('./App');

var oContainer = {
    width: "100%",
    height: "720px",
    opacity: "0.7",
    backgroundImage: `url(${Background})`
  };

class Container extends React.Component {
    render() {
        return (
        <section style={ oContainer }></section>
        );
    }
}


export default Container;
